import React from 'react';
import results from './results'

const Result = (props) => {
    console.log(props.names)
    return (
        <div>
            {props.names.map((names)=>(
                <div className="gallery" alt="image">
                    <p></p>{names}
                </div>
            ))}
            {props.movies.map((movies)=>(
                <div className="gallery" alt="image">
                    <img src={movies} alt="movie"/>
                </div>
            ))}
        </div>
    ); 
};

export default Result;
